#include <iostream>
#include <string>
#include <vector>
#include <algorithm>

using namespace std;

struct position {
    public:
        int x=0;
        int y=0;
        
        int getNumber() {
            return(x-(3*y)+5);
        }
        void up() {if(y<1){y++;};}
        void down() {if(y>-1){y--;};}
        void right() {if(x<1){x++;};}
        void left() {if(x>-1){x--;};}
        
        void move(char d) {
            switch(d) {
                case 'U':
                    up();
                    break;
                case 'D':
                    down();
                    break;
                case 'R':
                    right();
                    break;
                case 'L':
                    left();
                    break;
            }
        }
        
} pos;

int main() {
    int linecount = 5;
    string input[5] = {"", "", "", "", ""};
    for (int i = 0; i<linecount; i++) {
        for(int ch = 0; ch<input[i].length(); ch++) {
            pos.move(input[i][ch]);
        }
        std::cout << pos.getNumber() << std::endl;
    }
}